import React from "react";
import {ChangeEvent} from "react"

type CheckboxType = {
    check: boolean
    callBack: ()=>void
}



export const Checkbox =(props:CheckboxType)=> {

    const checkboxHandl =(event: ChangeEvent<HTMLInputElement>, cheked: boolean)=>{
        props.callBack
    }

    return(
        <input type="checkbox" checked={props.check} onChange={(event)=>checkboxHandl(event,event.currentTarget.checked)}></input>
    )
}
